const texteUnAng="I built fictive website that showcases the company.";
const texteDeuxAng="I developed a project to present fictive collection of stylish clothing.";
const texteTroisAng="I created a forum where users can interact with each other on the topic of poker.";
const texteUnFr="J'ai créé un site web fictif qui présente une entreprise. ";
const texteDeuxFr="J'ai développé un projet d'une collection fictive de vêtements élégants.";
const texteTroisFr="J'ai créé un forum où les utilisateurs peuvent interagir les uns avec les autres sur le sujet du poker.";
const titreUnAng="Presentation  of  company";
const titreDeuxAng="Display of clothing collection";
const titreTroisAng="Creation of Forum";
const titreUnFr="Présentation D'une Companie";
const titreDeuxFr="Exposition d'une collection de vêtements";
const titreTroisFr="Création d'un forum";

const tabProjet={
    titre:{
        fr:[titreUnFr,titreDeuxFr,titreTroisFr],
        ang:[titreUnAng,titreDeuxAng,titreTroisAng]
    },
    texte:{
        fr:[texteUnFr,texteDeuxFr,texteTroisFr],
        ang:[texteUnAng,texteDeuxAng,texteTroisAng]
    }
}

export default tabProjet;
